import './Signup.css'
// import {useState} from 'React'
import fb from './img/fb.png'
import tw from './img/tw.png'
import gp from './img/gp.png'


function Signup(){

    // const [Name, setName] = useState("")
    // const [Email, setEmail] = useState("")
    // const [Password, setPassword] = useState("")


    function register(){
        var x= document.getElementById("login");
        var y= document.getElementById("register");
        var z= document.getElementById("btn");
        x.style.left ="-400px";
        y.style.left ="50px";
        z.style.left ="110px";
    }
    function login(){
        var x= document.getElementById("login");
        var y= document.getElementById("register");
        var z= document.getElementById("btn");
        x.style.left ="50px";
        y.style.left ="450px";
        z.style.left ="0px";
    }

    
    return (
        <div className="box">
            <div className="form-box">
                <div className="button-box">
                    <div id="btn"></div>
                    <button type="button" className="toggle-btn" onClick={login}>LogIn</button>
                    <button type="button" className="toggle-btn" onClick={register}>Register</button>
                </div>
                <div className="social-icons">

                    <img src= {fb} alt="fb"/>
                    <img src= {tw} alt="tw"/>
                    <img src= {gp} alt="gp"/>
                </div>
                <form id="login" className="input-group">

                    <input type="text" className="input-field" placeholder="Enter userId" required />
                    <input type="text" className="input-field" placeholder="Enter Password" required />
                    <input type="checkbox" className="check-box" /><span>Remember Password</span>
                    <button type="submit" className="submit-btn">Login</button>
                </form>
                <form id="register" className="input-group">

                    <input type="text" className="input-field" placeholder="Enter Name" required />
                    <input type="email" className="input-field" placeholder="Enter email" required />
                    <input type="text" className="input-field" placeholder="Enter Password" required />
                    <input type="checkbox" className="check-box" /><span>I agree to terms {'&'} conditions</span>
                    <button type="submit" className="submit-btn">Register</button>
                </form>
            </div>
            
        </div>
    )
}

export default Signup
